import { Button } from 'antd';
import axios from 'axios'

export default function Home() {

    const ajax = ()=>{
        //取数据
        axios.get("http://localhost:8000/posts/2").then(res=>{
            console.log(res.data);
        })
    }
    return (
        <div>
            <Button type="primary" onClick={ajax}><h5>Button</h5></Button>
        </div>
    )
}
